import React, { Component } from "react";

class Node extends Component {
  state = {
    test: 0,
  };

  cum() {
    this.state.test += 1;
    console.log(this.state.test);
  }

  render() {
    return (
      <div>
        
        
        <div className="card" onClick={this.cum}></div>
      </div>
    );
  }
}

export default Node;
